from typing import List


class Solution:
    def maximumRemovals(self, s: str, p: str, removable: List[int]) -> int:
        positions = [[] for _ in range(len(p))]
        for i, char in enumerate(p):
            start_pos = 0
            while True:
                result = s[start_pos:].find(char)
                if result != -1:
                    positions[i].append(result + start_pos)
                    start_pos += result + 1
                else:
                    break

        i = 0
        for pos in removable:
            min_pos = -1
            for position in positions:
                if pos in position:
                    position.remove(pos)
                # find a position that is just greater than min_pos
                result = self.binary_search_pos(position, min_pos)
                if result < len(position):
                    min_pos = position[result]
                else:  # not found
                    return i
            i += 1

        return i

    def binary_search_pos(self, position: List[int], target_value: int):
        """
        https://stackoverflow.com/questions/6553970/find-the-first-element-in-a-sorted-array-that-is-greater-than-the-target
        https://www.geeksforgeeks.org/first-strictly-greater-element-in-a-sorted-array-in-java/
        """

        high = len(position)
        low = 0

        while high != low:

            mid = (high + low) // 2

            if position[mid] > target_value:
                high = mid
            else:
                low = mid + 1

        return low

